/**
 * Profile Page
 * Container for profile components
 */
import React from 'react';
import ProfileCard from '../components/profile/ProfileCard';

const Profile = () => {
  return (
    <div className="page-container">
      <ProfileCard />
    </div>
  );
};

export default Profile;
